import './product-item.css'
const ProductItem=(obj)=>{
 
  let object=obj.obj
 console.log(object)
 let element=""
 if(object!==undefined){
    element=object.model
    return(
<div className="productElement">
    <div></div>
    <div>
        <h5>{object.model}</h5>
        <h3>Цiна: {object.price}</h3>
    </div>
</div>
    ) 
 }
 
    return(
        <div className="productParent">
            {element}
        </div>
    )
}
export default ProductItem
